import React, { useState } from 'react';
import axios from 'axios';
import './App.css';
import { Container, Form, Button, Row, Col, Alert } from 'react-bootstrap';

function App() {
  const [date, setDate] = useState('');
  const [smallDogs, setSmallDogs] = useState(0);
  const [largeDogs, setLargeDogs] = useState(0);
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validation for past date
    const selectedDate = new Date(date);
    const today = new Date();
    today.setHours(0, 0, 0, 0); // Reset time portion

    if (selectedDate < today) {
      setError('A data selecionada já passou.');
      return;
    }

    // Validation for zero dogs
    if (smallDogs <= 0 && largeDogs <= 0) {
      setError('Você deve adicionar pelo menos um cão pequeno ou grande.');
      return;
    }

    // Validation for negative numbers
    if (smallDogs < 0 || largeDogs < 0) {
      setError('O número de cachorros não pode ser negativo.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:3000/api/best-petshop', {
        date,
        smallDogs: parseInt(smallDogs),
        largeDogs: parseInt(largeDogs),
      });
      setResult(response.data);
      setError(''); // Clear any previous error
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Ocorreu um erro ao buscar os dados.');
    }
  };

  return (
    <div className="body-container">
      <Container className="main-content mt-5">
        <h1 className="text-center mb-4">Encontre o Melhor Petshop</h1>
        <div className="form-container">
          <Form onSubmit={handleSubmit}>
            <Form.Group as={Row} controlId="formDate">
              <Form.Label column sm={2}>
                Data:
              </Form.Label>
              <Col sm={10}>
                <Form.Control
                  type="date"
                  value={date}
                  onChange={(e) => setDate(e.target.value)}
                  required
                />
              </Col>
            </Form.Group>

            <Form.Group as={Row} controlId="formSmallDogs">
              <Form.Label column sm={2}>
                Cães Pequenos:
              </Form.Label>
              <Col sm={10}>
                <Form.Control
                  type="number"
                  value={smallDogs}
                  onChange={(e) => setSmallDogs(Math.max(0, e.target.value))}
                  required
                />
              </Col>
            </Form.Group>

            <Form.Group as={Row} controlId="formLargeDogs">
              <Form.Label column sm={2}>
                Cães Grandes:
              </Form.Label>
              <Col sm={10}>
                <Form.Control
                  type="number"
                  value={largeDogs}
                  onChange={(e) => setLargeDogs(Math.max(0, e.target.value))}
                  required
                />
              </Col>
            </Form.Group>

            {error && (
              <Alert variant="danger" className="mt-3">
                {error}
              </Alert>
            )}

            <Button
              variant="primary"
              type="submit"
              className="btn-find-petshop mt-3"
            >
              Encontrar Melhor Petshop
            </Button>
          </Form>
        </div>

        {result && (
          <div className="result-container mt-4">
            <h4 className="mb-3">Melhor Petshop: {result.petshop}</h4>
            <p>Preço Total: R${result.price}</p>
          </div>
        )}
      </Container>
    </div>
  );
}

export default App;
